import React from 'react';
import './SearchPanel.css';

const SearchPanel = () => {
	const searchText = 'type to search';
	const searchStyle = {
		fontSize: '20px'
	};
	return(
		<input className="search-input" style={searchStyle} placeholder={searchText}/>
	);
};

export default SearchPanel;
